'use strict';

var Curry = require("@rescript/std/lib/js/curry.js");

function first(v) {
  return v[0];
}

function second(v) {
  return v[1];
}

function toFnCall(fn, param) {
  return Curry._2(fn, param[0], param[1]);
}

exports.first = first;
exports.second = second;
exports.toFnCall = toFnCall;
/* No side effect */
